import { useNavigate } from 'react-router-dom';
export default function Navbar({ onLogout }) {
    const navigate = useNavigate();

    const handleLogout = () => {
        onLogout();
        navigate('/login');
    };

    return (
        <div className="navbar">
            <h2>Forum App</h2>
            <button onClick={handleLogout}>Logout</button>
        </div>
    );
}
